import React, { Component, lazy, Suspense } from 'react';
// import React, {Component} from "react";
import logo from './logo.svg';

//Data
import PhotoData from "./testData";

//Lasy
const LazyPhotoComponet = lazy(() => import("./lazyComponet"));
// import LazyPhotoComponet from "./lazyComponet";



class lazyContainer extends Component {
    constructor(){
        super();
        this.state = {
            photoDB: {},
            isConected: false,
            albumLevel: true,
            photoLevel: false,
            isMore: true
        };
    };

    componentDidMount(){
        // fetch('https://jsonplaceholder.typicode.com/photos/1')
        fetch('https://jsonplaceholder.typicode.com/photos?_page=1&_limt=10')
        .then(response => response.json())
        .then(data => {
            this.setState({
            photoDB: data,
            isConected: true,
            albumLevel: true
            });
            console.log(data);
        });
    };

    handleClick = (event) => {/*No bind needed */
        var myJSON = JSON.stringify(event.target);
        console.log("e " + myJSON);
        // this.setState({
        //     // firstName: event.target.value
        //     [event.target.name]: event.target.value

        // })
        // const {name, value, type, checked} = event.target;
        // type === "checkbox" ? this.setState({ [name] : checked }) : this.setState({ [name] : value })
        // if(type === "checkbox") this.setState({ [name] : checked })
        // else if(type === "textarea") this.setState({ [value] : value })
        //     else this.setState({ [name] : value })

    }

    render() {
        const photoData = this.state.photoDB;
        console.log("pDATA " + photoData[0])
        var myJSON = JSON.stringify(photoData[0]);
        console.log("pDATA " + myJSON)
        console.log(" ")
        console.log("PDATA " + PhotoData[0])
        myJSON = JSON.stringify(PhotoData[0]);
        console.log("pDATA " + myJSON)

        
        const photoComponets = PhotoData.map(
            item => 
            <LazyPhotoComponet key={item.id} data={item}
            handleClick={this.handleClick}
            />
            )
      return (
        <div>
            {/* <LazyPhotoComponet
                data={this.state}
                handleChange={this.handleChange}
            /> */}
            <Suspense fallback={<div>Loading ....<img src={logo} className="App-logo" alt="logo" /></div>}>
            {photoComponets}
            </Suspense>
            {/* {this.state.photoDB.id} */}
          {/* <Suspense fallback={<div>Loading ....<img src={logo} className="App-logo" alt="logo" /></div>}>
            <LazyPhotoComponet
                data={this.state}
                handleChange={this.handleChange}
            />
          </Suspense> */}
        </div>
      );
    }
  }
  
  export default lazyContainer;
